The Cell enum also contains a few variants that can only be produced as output of Marwood's evaluator. For example, the Cell::Void variant is produced by some Marwood procedures that evaluate to #<void> (e.g. define, set!). It is not possible to produce these variants via Marwood's parser. #[derive(Debug, Eq, PartialEq, Hash, Clone)]
pub enum Cell { ... Continuation, Macro, Procedure(Option<String>), Undefined, Void,
}

