Marwood's lexer is in the form: fn scan(text: &str) -> Result<Vec<Token>, Error> Given scheme code as input, the scan function returns a vector of tokens according to the Scheme grammar Each token contains a span, which may be used to extract the token's text from the source text, and the token type (e.g. LeftParen). pub struct Token { /// (start, end) index of original span in the source &str pub span: (usize, usize), /// The type output by the scanner pub token_type: TokenType,
} pub enum TokenType { Char, Dot, False, LeftParen, Number, NumberPrefix, RightParen, SingleQuote, String, Symbol, True, WhiteSpace, HashParen,
}

