Marwood has a stack based virtual machine represented by the Vm object. Each Vm represents a full scheme runtime environment. Scheme expressions evaluated on the VM are compiled into byte code represented by [op codes], which are evaluated by the VM. #[derive(Debug)]
pub struct Vm { /// The heap and global environment heap: Heap, globenv: GlobalEnvironment, /// The current program stack stack: Stack, /// Registers acc: VCell, ep: usize, ip: (usize, usize), bp: usize, /// System Interface (display, write, etc). sys: Box<dyn SystemInterface>,
} The Vm object provides an eval interface for evaluating scheme expressions, and is the main interface for the console and web repl: fn eval(&mut self, cell: &Cell) -> Result<Cell, Error>

