VCell's primary role is to represent scheme data in Marwood's VM, but it's also used to represent Marwood's internal instruction format (byte code) and values on Marwood's stack, heap, global and lexical environments. The remaining VCell variants are used to represent the various types that may be encountered. #[derive(Clone, Debug, Eq, PartialEq)]
pub enum VCell { ... Continuation(Rc<Continuation>), Closure(usize, usize), Lambda(Rc<Lambda>), LexicalEnv(Rc<LexicalEnvironment>), LexicalEnvSlot(usize), LexicalEnvPtr(usize, usize), Macro(Rc<Transform>), Acc, ArgumentCount(usize), BasePointer(usize), BasePointerOffset(i64), BuiltInProc(Rc<BuiltInProc>), EnvironmentPointer(usize), GlobalEnvSlot(usize), InstructionPointer(usize, usize), OpCode(OpCode), Ptr(usize),
}
